INSERT INTO `mw_article` VALUES (2,'CAN-SPAM Act: A Compliance Guide for Business','can-spam-act-compliance-guide-business','<p>Do you use email in your business? The CAN-SPAM Act, a law that sets the rules for commercial email, establishes requirements for commercial messages, gives recipients the right to have you stop emailing them, and spells out tough penalties for violations.</p>\n\n<p>Despite its name, the CAN-SPAM Act doesn’t apply just to bulk email. It covers all commercial messages, which the law defines as “any electronic mail message the primary purpose of which is the commercial advertisement or promotion of a commercial product or service,” including email that promotes content on commercial websites. The law makes no exception for business-to-business email. That means all email – for example, a message to former customers announcing a new product line – must comply with the law.</p>\n\n<p>Each separate email in violation of the CAN-SPAM Act is subject to penalties of up to $16,000, so non-compliance can be costly. But following the law isn’t complicated. Here’s a rundown of CAN-SPAM’s main requirements:</p>\n\n<ol style=\"margin-left:15px;margin-right:0px;\"><li><strong>Don’t use false or misleading header information.</strong> Your “From,” “To,” “Reply-To,” and routing information – including the originating domain name and email address – must be accurate and identify the person or business who initiated the message.</li>\n	<li><strong>Don’t use deceptive subject lines.</strong> The subject line must accurately reflect the content of the message.</li>\n	<li><strong>Identify the message as an ad.</strong> The law gives you a lot of leeway in how to do this, but you must disclose clearly and conspicuously that your message is an advertisement.</li>\n	<li><strong>Tell recipients where you’re located.</strong> Your message must include your valid physical postal address. This can be your current street address, a post office box you’ve registered with the U.S. Postal Service, or a private mailbox you’ve registered with a commercial mail receiving agency established under Postal Service regulations.</li>\n	<li><strong>Tell recipients how to opt out of receiving future email from you.</strong> Your message must include a clear and conspicuous explanation of how the recipient can opt out of getting email from you in the future. Craft the notice in a way that’s easy for an ordinary person to recognize, read, and understand. Creative use of type size, color, and location can improve clarity. Give a return email address or another easy Internet-based way to allow people to communicate their choice to you. You may create a menu to allow a recipient to opt out of certain types of messages, but you must include the option to stop all commercial messages from you. Make sure your spam filter doesn’t block these opt-out requests.</li>\n	<li><strong>Honor opt-out requests promptly.</strong> Any opt-out mechanism you offer must be able to process opt-out requests for at least 30 days after you send your message. You must honor a recipient’s opt-out request within 10 business days. You can’t charge a fee, require the recipient to give you any personally identifying information beyond an email address, or make the recipient take any step other than sending a reply email or visiting a single page on an Internet website as a condition for honoring an opt-out request. Once people have told you they don’t want to receive more messages from you, you can’t sell or transfer their email addresses, even in the form of a mailing list. The only exception is that you may transfer the addresses to a company you’ve hired to help you comply with the CAN-SPAM Act.</li>\n	<li><strong>Monitor what others are doing on your behalf.</strong> The law makes clear that even if you hire another company to handle your email marketing, you can’t contract away your legal responsibility to comply with the law. Both the company whose product is promoted in the message and the company that actually sends the message may be held legally responsible.</li>\n</ol>\n \n\n<h3>Need more information?</h3>\nPlease visit <a href=\"http://www.business.ftc.gov/documents/bus61-can-spam-act-compliance-guide-business\" target=\"_blank\">http://www.business.ftc.gov/documents/bus61-can-spam-act-compliance-guide-business</a><br />\n ','published','2013-10-24 11:08:05','2013-10-25 11:02:06'),(8,'Campaign tags and filters','campaign-tag-filters','When sending a campaign, you are able to use a number of custom tags and filters.<br />\nMost common tags are listed below: <br /><br />\n \n<div class=\"col-lg-12\">\n<table class=\"table table-bordered table-hover table-striped\"><tbody><tr><td>Tag</td>\n			<td>Required</td>\n		</tr><tr><td>[UNSUBSCRIBE_URL]</td>\n			<td>YES</td>\n		</tr><tr><td>[COMPANY_FULL_ADDRESS]</td>\n			<td>YES</td>\n		</tr><tr><td>[UPDATE_PROFILE_URL]</td>\n			<td>NO</td>\n		</tr><tr><td>[WEB_VERSION_URL]</td>\n			<td>NO</td>\n		</tr><tr><td>[CAMPAIGN_URL]</td>\n			<td>NO</td>\n		</tr><tr><td>[LIST_NAME]</td>\n			<td>NO</td>\n		</tr><tr><td>[LIST_SUBJECT]</td>\n			<td>NO</td>\n		</tr><tr><td>[LIST_DESCRIPTION]</td>\n			<td>NO</td>\n		</tr><tr><td>[LIST_FROM_NAME]</td>\n			<td>NO</td>\n		</tr><tr><td>[CURRENT_YEAR]</td>\n			<td>NO</td>\n		</tr><tr><td>[CURRENT_MONTH]</td>\n			<td>NO</td>\n		</tr><tr><td>[CURRENT_DAY]</td>\n			<td>NO</td>\n		</tr><tr><td>[CURRENT_DATE]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_NAME]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_ADDRESS_1]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_ADDRESS_2]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_CITY]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_ZONE]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_ZIP]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_COUNTRY]</td>\n			<td>NO</td>\n		</tr><tr><td>[COMPANY_PHONE]</td>\n			<td>NO</td>\n		</tr><tr><td>[CAMPAIGN_SUBJECT]</td>\n			<td>NO</td>\n		</tr><tr><td>[CAMPAIGN_TO_NAME]</td>\n			<td>NO</td>\n		</tr><tr><td>[CAMPAIGN_FROM_NAME]</td>\n			<td>NO</td>\n		</tr><tr><td>[CAMPAIGN_REPLY_TO]</td>\n			<td>NO</td>\n		</tr><tr><td>[CAMPAIGN_UID]</td>\n			<td>NO</td>\n		</tr><tr><td>[SUBSCRIBER_UID]</td>\n			<td>NO</td>\n		</tr><tr><td>[EMAIL]</td>\n			<td>NO</td>\n		</tr><tr><td>[FNAME]</td>\n			<td>NO</td>\n		</tr><tr><td>[LNAME]</td>\n			<td>NO</td>\n		</tr></tbody></table></div>\n\n<div class=\"clearfix\"> </div>\nNow, each of the above tags is able to receive a set of filters.<br />\nFilters are a simple way of transforming the tag in a way or another, for example you might want to embed a sharing link to twitter in your campaign, say the campaign url itself.<br /><br />\nUsing only the tags you would embed it like:<br /><br /><code>https://twitter.com/intent/tweet?text=[CAMPAIGN_SUBJECT]&amp;url=[CAMPAIGN_URL] </code><br /><br />\nBut there is a problem, because twitter expects your arguments to be url encoded, and by that, i mean twitter expects to get<br /><br /><code>https://twitter.com/intent/tweet?text=my%20super%20campaign&amp;url=http%3A%2F%2Fwww.domain.com%2Fcampaigns%2F1cart129djat3</code><br /><br />\nbut instead it will get <code>https://twitter.com/intent/tweet?text=my super campaign&amp;url=http://www.domain.com/campaigns/1cart129djat3</code><br /><br />\nIn order to overcome this issue, we will apply filters over our tags, therefore, the twitter url becomes:<br /><br /><code>https://twitter.com/intent/tweet?text=[CAMPAIGN_SUBJECT:filter:urlencode]&amp;url=[CAMPAIGN_URL:filter:urlencode] </code><br /><br />\nPretty simple eh?<br />\nBut we can do even more, let\'s say we want to make sure our twitter text starts with a capitalized letter and the rest of the letters will be lowercase.<br />\nIn order to accomplish this, we can apply multiple filters(separate by a pipe) to same tag, for example: <br /><br /><code>https://twitter.com/intent/tweet?text=[CAMPAIGN_SUBJECT:filter:lowercase|ucfirst|urlencode]&amp;url=[CAMPAIGN_URL:filter:urlencode] </code><br />\nPlease note, the order in which you add the filters is the same order they are applied.<br /><br />\nBellow is the entire list of filters, for now there are a few, but in the future the number might increase.\n<div class=\"clearfix\"> </div>\n\n<div class=\"col-lg-12\">\n<table class=\"table table-bordered table-hover table-striped\"><tbody><tr><td>urlencode</td>\n			<td>will urlencode your tag</td>\n		</tr><tr><td>rawurlencode</td>\n			<td>will rawurlencode your url</td>\n		</tr><tr><td>htmlencode</td>\n			<td>will convert html tags into their entities</td>\n		</tr><tr><td>trim</td>\n			<td>will trim the white spaces from begining and end of your tag</td>\n		</tr><tr><td>uppercase</td>\n			<td>will transform your tag in uppercase only chars</td>\n		</tr><tr><td>lowercase</td>\n			<td>will transform your tag in lowercase only chars</td>\n		</tr><tr><td>ucwords</td>\n			<td>will capitalize each first letter from your tag content</td>\n		</tr><tr><td>ucfirst</td>\n			<td>will capitalize only the first letter of your tag</td>\n		</tr><tr><td>reverse</td>\n			<td>will reverse your tag content</td>\n		</tr></tbody></table></div>\n\n<div class=\"clearfix\"> </div>\n','published','2013-10-24 22:47:27','2013-10-25 11:02:00');
