INSERT INTO `mw_list_page_type` VALUES (1,'Subscribe form','subscribe-form','When the user will reach the subscription form, they will see this page .','<div class=\"box box-primary borderless\">\n<div class=\"box-header\">\n<h3 class=\"box-title\">[LIST_NAME]</h3>\n</div>\n\n<div class=\"box-body\">\n<div class=\"callout callout-info\">We\'re happy you decided to subscribe to our email list.<br />\nPlease take a few seconds and fill in the list details in order to subscribe to our list.<br />\nYou will receive an email to confirm your subscription, just to be sure this is your email address.</div>\n[LIST_FIELDS]</div>\n\n<div class=\"box-footer\">\n<div class=\"pull-right\">[SUBMIT_BUTTON]</div>\n\n<div class=\"clearfix\"> </div>\n</div>\n</div>\n','no','a:0:{}','2013-09-02 21:47:32','2014-03-15 14:54:24'),(2,'Pending subscribe','subscribe-pending','After the user will submit the subscription form, they will see this page.','<div class=\"box box-primary borderless\">\n<div class=\"box-header\">\n<h3 class=\"box-title\">[LIST_NAME]</h3>\n</div>\n\n<div class=\"box-body\">\n<div class=\"callout callout-info\">Please check your email address in order to confirm your subscription.<br />\nThanks.</div>\n</div>\n</div>\n','no','a:0:{}','2013-09-02 21:47:56','2014-03-15 14:54:24'),(3,'Subscription confirmed','subscribe-confirm','After the user will click the confirmation link from within the email, they will see this page.','<div class=\"box box-primary borderless\">\n<div class=\"box-header\">\n<h3 class=\"box-title\">[LIST_NAME]</h3>\n</div>\n\n<div class=\"box-body\">\n<div class=\"callout callout-info\">Congratulations, your subscription is now complete.<br />\nYou can always update your profile by visiting the following url:<br /><a href=\"[UPDATE_PROFILE_URL]\">Update profile</a></div>\n</div>\n</div>\n','no','a:0:{}','2013-09-02 21:48:48','2014-03-15 14:54:24'),(4,'Update Profile','update-profile','This page will contain all the elements the subscription form contains, the only difference is the heading message.','<div class=\"box box-primary borderless\">\n<div class=\"box-header\">\n<h3 class=\"box-title\">[LIST_NAME]</h3>\n</div>\n\n<div class=\"box-body\">\n<div class=\"callout callout-info\">Use this form to update your profile information.</div>\n[LIST_FIELDS]</div>\n\n<div class=\"box-footer\">\n<div class=\"pull-right\">[SUBMIT_BUTTON]</div>\n\n<div class=\"clearfix\"> </div>\n</div>\n</div>\n','no','a:0:{}','2013-09-02 21:49:40','2014-03-15 14:54:24'),(5,'Unsubscribe form','unsubscribe-form','This is the form the user will see when following the unsubscribe link.','<div class=\"box box-primary borderless\">\n<div class=\"box-header\">\n<h3 class=\"box-title\">[LIST_NAME]</h3>\n</div>\n\n<div class=\"box-body\">\n<div class=\"callout callout-info\">We\'re sorry to see you go, but hey, no hard feelings, hopefully we will see you back one day.<br />\nPlease fill in your email address in order to unsubscribe from the list.<br />\nYou will receive an email to confirm your unsubscription, just to make sure this is not an accident or somebody else tries to unsubscribe you.</div>\n[UNSUBSCRIBE_EMAIL_FIELD]<br />\n[UNSUBSCRIBE_REASON_FIELD]</div>\n\n<div class=\"box-footer\">\n<div class=\"pull-right\">[SUBMIT_BUTTON]</div>\n\n<div class=\"clearfix\"> </div>\n</div>\n</div>\n','no','a:0:{}','2013-09-03 11:18:44','2014-03-15 14:54:24'),(6,'Unsubscribe confirmation','unsubscribe-confirm','When the user clicks on the unsubscribe link from within the email, they will see this page.','<div class=\"box box-primary borderless\">\n<div class=\"box-header\">\n<h3 class=\"box-title\">[LIST_NAME]</h3>\n</div>\n\n<div class=\"box-body\">\n<div class=\"callout callout-info\">You were successfully removed from the [LIST_NAME] list.<br />\nHopefully you will come back one day.<br /><br />\nHaving doubts?<br />\nPlease click <a href=\"[SUBSCRIBE_URL]\">here</a> in order to subscribe again to the list.</div>\n</div>\n</div>\n','no','a:0:{}','2013-09-03 12:14:37','2014-03-15 14:54:24'),(7,'Subscribe confirm email','subscribe-confirm-email','The email the user receives with the confirmation link','<!DOCTYPE html>\n<html><head><title>[LIST_NAME]</title><meta content=\"utf-8\" name=\"charset\"><style type=\"text/css\">\n\n	\n	\n	#outlook a{padding:0;}\n	body {width:100% !important; -webkit-text-size-adjust:none; margin:0; padding:0; font-family:  sans-serif; background: #f5f5f5; font-size:12px;}\n	img {border:0;height:auto;line-height:100%;outline:none;text-decoration:none;}\n	table td{border-collapse:collapse;}\n	a {color: #008ca9;text-decoration:none}\n	a:hover {color: #008ca9;text-decoration:none;}\n	#wrap {background:#f5f5f5; padding:10px;}\n	table#main-table {-webkit-border-radius:5px;-moz-border-radius:5px;border-radius:5px; border:1px solid #008ca9; overflow:hidden; background: #FFFFFF; width: 600px}\n	h1{padding:0; margin:0; font-family: sans-serif;font-size:25px;font-style:italic;color:#FFFFFF; font-weight:bold;}\n	h1 small{font-size:13px;font-weight:normal; font-family:  sans-serif; font-style:italic;}\n	h6{font-size:10px;color:#FFFFFF;margin:0;padding:0;font-weight:normal}\n	.darkbg {background: #008ca9}\n	input{outline:none}\n</style>\n</head><body dir=\"undefined\" style=\"width:100%;-webkit-text-size-adjust:none;margin:0;padding:0;font-family:sans-serif;background:#f5f5f5;font-size:12px\">\n                \n            <div id=\"wrap\" style=\"background:#f5f5f5;padding:10px\">\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"main-table\" style=\"-webkit-border-radius:5px;-moz-border-radius:5px;border-radius:5px;border:1px solid #008ca9;overflow:hidden;background:#FFFFFF;width:600px\"><tbody><tr><td class=\"darkbg\" style=\"border-collapse:collapse;background:#008ca9\">\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"20\" width=\"100%\"><tbody><tr><td style=\"border-collapse:collapse\">\n						<h1 style=\"padding:0;margin:0;font-family:sans-serif;font-siz