se:collapse\">&nbsp;</td>\n					</tr></tbody></table></td>\n		</tr><tr><td class=\"darkbg\" style=\"padding:10px;border-collapse:collapse;background:#008ca9\">\n			<h6 style=\"font-size:10px;color:#FFFFFF;margin:0;padding:0;font-weight:normal\">&copy; [CURRENT_YEAR] [COMPANY_NAME]. All rights reserved</h6>\n			</td>\n		</tr></tbody></table></div></body></html>\n','yes','a:0:{}','2013-09-05 13:39:56','2014-03-15 14:54:24'),(9,'Welcome email','welcome-email','The email the user receives after they successfully subscribe into the list','<!DOCTYPE html>\n<html><head><title>[LIST_NAME]</title><meta content=\"utf-8\" name=\"charset\">\n<style type=\"text/css\">\n#outlook a{padding:0;}\n	body {width:100% !important; -webkit-text-size-adjust:none; margin:0; padding:0; font-family:  sans-serif; background: #f5f5f5; font-size:12px;}\n	img {border:0;height:auto;line-height:100%;outline:none;text-decoration:none;}\n	table td{border-collapse:collapse;}\n	a {color: #008ca9;text-decoration:none}\n	a:hover {color: #008ca9;text-decoration:none;}\n	#wrap {background:#f5f5f5; padding:10px;}\n	table#main-table {-webkit-border-radius:5px;-moz-border-radius:5px;border-radius:5px; border:1px solid #008ca9; overflow:hidden; background: #FFFFFF; width: 600px}\n	h1{padding:0; margin:0; font-family: sans-serif;font-size:25px;font-style:italic;color:#FFFFFF; font-weight:bold;}\n	h1 small{font-size:13px;font-weight:normal; font-family:  sans-serif; font-style:italic;}\n	h6{font-size:10px;color:#FFFFFF;margin:0;padding:0;font-weight:normal}\n	.darkbg {background: #008ca9}\n	input{outline:none}\n</style>\n</head><body style=\"width:100%;-webkit-text-size-adjust:none;margin:0;padding:0;font-family:sans-serif;background:#f5f5f5;font-size:12px\">\n                \n            <div id=\"wrap\" style=\"background:#f5f5f5;padding:10px\">\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"main-table\" style=\"-webkit-border-radius:5px;-moz-border-radius:5px;border-radius:5px;border:1px solid #008ca9;overflow:hidden;background:#FFFFFF;width:600px\"><tbody><tr><td class=\"darkbg\" style=\"border-collapse:collapse;background:#008ca9\">\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"20\" width=\"100%\"><tbody><tr><td style=\"border-collapse:collapse\">\n						<h1 style=\"padding:0;margin:0;font-family:sans-serif;font-size:25px;font-style:italic;color:#FFFFFF;font-weight:bold\">[LIST_NAME] <small style=\"font-size:13px;font-weight:normal;font-family:sans-serif;font-style:italic\">[COMPANY_NAME]</small></h1>\n						</td>\n					</tr></tbody></table></td>\n		</tr><tr><td style=\"border-collapse:collapse\">\n			<table border=\"0\" cellpadding=\"20\" cellspacing=\"0\" width=\"100%\"><tbody><tr><td style=\"border-collapse:collapse\">&nbsp;</td>\n					</tr><tr><td style=\"border-collapse:collapse\">Thank you for subscribing into [LIST_NAME] email list.<br>\n						You can update your information at any time by clicking <a href=\"[UPDATE_PROFILE_URL]\" style=\"color:#008ca9;text-decoration:none\">here</a>.<br>\n						Thank you.</td>\n					</tr><tr><td style=\"border-collapse:collapse\">&nbsp;</td>\n					</tr></tbody></table></td>\n		</tr><tr><td class=\"darkbg\" style=\"padding:10px;border-collapse:collapse;background:#008ca9\">\n			<h6 style=\"font-size:10px;color:#FFFFFF;margin:0;padding:0;font-weight:normal\">&copy; [CURRENT_YEAR] [COMPANY_NAME]. All rights reserved</h6>\n			</td>\n		</tr></tbody></table></div></body></html>\n','yes','a:0:{}','2013-09-05 13:39:56','2015-03-19 11:13:09'),(10,'Subscription confirmed approval','subscribe-confirm-approval','After the user will click the confirmation link from within the email, if the list requires confirm approval, they will see this page.','<div class=\"box box-primary borderless\">\n<div class=\"box-header\">\n<h3 class=\"box-title\">[LIST_NAME]</h3>\n</div>\n\n<div class=\"box-body\">\n<div class=\"callout callout-info\">Congratulations, your subscription is now complete and awaiting approval.<br />\nOnce the approval process is done, you will get a confirmation email with further instructions.<br />\nThanks.</div>\n</div>\n</div>\n','no','a:0:{}','2013-09-02 21:48:48','2014-03-15 14:54:24'),(11,'Subscription confirmed approval email','subscribe-confirm-approval-email','The email the user receives after their subscription is approved.','<!DOCTYPE html>\r\n<html><head><title>[LIST_NAME]</title><meta content=\"utf-8\" name=\"charset\">\r\n<style type=\"text/css\">\r\n#outlook a{padding:0;}\r\n	body {width:100% !important; -webkit-text-size-adjust:none; margin:0; padding:0; font-family:  sans-serif; background: #f5f5f5; font-size:12px;}\r\n	img {border:0;height:auto;line-height:100%;outline:none;text-decoration:none;}\r\n	table td{border-collapse:collapse;}\r\n	a {color: #008ca9;text-decoration:none}\r\n	a:hover {color: #008ca9;text-decoration:none;}\r\n	#wrap {background:#f5f5f5; padding:10px;}\r\n	table#main-table {-webkit-border-radius:5px;-moz-border-radius:5px;border-radius:5px; border:1px solid #008ca9; overflow:hidden; background: #FFFFFF; width: 600px}\r\n	h1{padding:0; margin:0; font-family: sans-serif;font-size:25px;font-style:italic;color:#FFFFFF; font-weight:bold;}\r\n	h1 small{font-size:13px;font-weight:normal; font-family:  sans-serif; font-style:italic;}\r\n	h6{font-size:10px;color:#FFFFFF;margin:0;padding:0;font-weight:normal}\r\n	.darkbg {background: #008ca9}\r\n	input{outline:none}\r\n</style>\r\n</head><body style=\"width:100%;-webkit-text-size-adjust:none;margin:0;padding:0;font-family:sans-serif;background:#f5f5f5;font-size:12px\">\r\n                \r\n            <div id=\"wrap\" style=\"background:#f5f5f5;padding:10px\">\r\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"main-table\" style=\"-webkit-border-radius:5px;-moz-border-radius:5px;border-radius:5px;border:1px solid #008ca9;overflow:hidden;background:#FFFFFF;width:600px\"><tbody><tr><td class=\"darkbg\" style=\"border-collapse:collapse;background:#008ca9\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"20\" width=\"100%\"><tbody><tr><td style=\"border-collapse:collapse\">\r\n						<h1 style=\"padding:0;margin:0;font-family:sans-serif;font-size:25px;font-style:italic;color:#FFFFFF;font-weight:bold\">[LIST_NAME] <small style=\"font-size:13px;font-weight:normal;font-family:sans-serif;font-style:italic\">[COMPANY_NAME]</small></h1>\r\n						</td>\r\n					</tr></tbody></table></td>\r\n		</tr><tr><td style=\"border-collapse:collapse\">\r\n			<table border=\"0\" cellpadding=\"20\" cellspacing=\"0\" width=\"100%\"><tbody><tr><td style=\"border-collapse:collapse\">&nbsp;</td>\r\n					</tr><tr><td style=\"border-collapse:collapse\">Congratulations, <br />Your subscription into [LIST_NAME] email list is now approved.<br>\r\n						You can update your information at any time by clicking <a href=\"[UPDATE_PROFILE_URL]\" style=\"color:#008ca9;text-decoration:none\">here</a>.<br>\r\n						Thank you.</td>\r\n					</tr><tr><td style=\"border-collapse:collapse\">&nbsp;</td>\r\n					</tr></tbody></table></td>\r\n		</tr><tr><td class=\"darkbg\" style=\"padding:10px;border-collapse:collapse;background:#008ca9\">\r\n			<h6 style=\"font-size:10px;color:#FFFFFF;margin:0;padding:0;font-weight:normal\">&copy; [CURRENT_YEAR] [COMPANY_NAME]. All rights reserved</h6>\r\n			</td>\r\n		</tr></tbody></table></div></body></html>\r\n','yes','a:0:{}','2013-09-05 13:39:56','2015-03-19 11:13:09');
